import Axios from 'axios'

const TableData = () => {
    Axios.get("http://localhost:4500/view-all").then( (response) => {
      console.log("Retrieved login data");
      console.log(response.data)
      return (response.data)
    });
  };

const LoginTable = () => {
  {TableData.forEach((val, key) => {
    return(
      <div>
      <h3>Website: {val.websiteName}</h3>
      <h3>Domain: {val.websiteDomain}</h3>
      <h3>Username: {val.username}</h3>
      <h3>Password: {val.password}</h3>
      </div>
    )
  })}
}

export default LoginTable;
